  <title>BARCODE by Sanz v1.0 - Offline Mode</title>
   <style>
.results,h1{text-align:center}:root{--primary-color:#007bff;--background-color:#f9f9f9;--text-color:#333}[data-theme=dark]{--primary-color:#4e9aff;--background-color:#222;--text-color:#f0f0f0}body{font-family:Arial,sans-serif;margin:0;padding:0;background-color:var(--background-color);color:var(--text-color)}.switch-mode,button{cursor:pointer;font-size:16px;color:#fff}.container{max-width:800px;margin:20px auto;padding:15px;background-color:#fff;border-radius:8px;box-shadow:0 4px 10px rgba(0,0,0,.1);background-color:var(--background-color)}@keyframes gradientAnimation{0%{background-position:0}100%{background-position:100%}}textarea{width:calc(100% - 20px);height:100px;margin:10px;padding:10px;font-size:16px;border:1px solid #ccc;border-radius:5px;resize:none;box-sizing:border-box}button{background-color:var(--primary-color);padding:10px 20px;border:none;border-radius:5px}button:hover{background-color:#0056b3}.actions{display:flex;justify-content:center;gap:10px}#downloadPdfBtn{display:none}.results{margin-top:20px;max-height:300px;overflow-y:auto;border:1px solid var(--primary-color);border-radius:8px;padding:10px;background:rgba(0,0,0,.05)}.result-item{padding:10px;border-bottom:1px solid #ddd}.result-item:last-child{border-bottom:none}.barcode{margin:10px 0}.switch-mode{position:fixed;top:15px;right:15px;background-color:var(--primary-color);padding:5px 10px;border-radius:5px}[data-theme=dark] .switch-mode{background-color:#333;color:#f0f0f0}@keyframes fontColorChange{0%{color:red}25%{color:orange}50%{color:green}75%{color:#00f}100%{color:purple}}.dynamic-font{animation:3s infinite fontColorChange}
  </style>
</head>
<script type="text/javascript">
  function getPLUFromURL() {
    const urlParams = new URLSearchParams(window.location.search);
    return urlParams.get('plu') || null;
  }

  function generateBarcode(plu) {
    if (!plu) {
      document.body.innerHTML += "<p style='color:red; font-size: 16px;'>PLU tidak ditemukan</p>";
      return;
    }

    // Pastikan JsBarcode sudah dimuat
    if (typeof JsBarcode !== "undefined") {
      JsBarcode("#barcode", plu, { format: "EAN13", displayValue: true });
    } else {
      document.body.innerHTML += "<p style='color:red; font-size: 16px;'>Error: JsBarcode tidak ditemukan.</p>";
    }
  }

  // Ambil PLU dari URL dan buat barcode
  const plu = getPLUFromURL();
  generateBarcode(plu);
</script>
<body>



<!-- Konten Utama -->

<div class="switch-mode" onclick="toggleTheme()">Mode: <span id="modeText">Terang</span></div>

<div class="container">
    <h1><span class="dynamic-font">BARCODE by Sanz v1.0</span></h1>
    <textarea id="searchInput" placeholder="Lebokno PLU atau jeneng item (pisahno karo newline, koma, spasi, atau |)"></textarea>
    
    <div class="actions">
        <button onclick="searchData()">Cari</button>
        <button onclick="refreshPage()">Refresh</button> <!-- Tombol Refresh Ditambahkan -->
    </div>

    <div class="results" id="results"></div>

    <div class="dropdown" id="notFoundList" style="display: none;">
        <details>
            <summary>Data Orak Ditemukno</summary>
            <ul id="notFoundItems"></ul>
        </details>
    </div>
</div>

<!-- JavaScript untuk Tombol Refresh -->
<script>
    function refreshPage() {
        window.location.href = window.location.href.split('?')[0] + '?t=' + new Date().getTime();
    }
